import {Link} from 'react-router-dom';


function Navigation(){
    return (
        <nav className ="App-nav">
            <Link to ="/">Home</Link>
            <p></p>
            <Link to ="/shop">Shop</Link>
            <p></p>
            <Link to ="/register">Register</Link>
        </nav>
    );
}

export default Navigation;
